import React from 'react';
import ReactDOM from 'react-dom';
import './custom.css';
/*import App from './App';*/

class TaskComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            task: []
        };
    }
    componentDidMount() {
        fetch("api/Task/Index").then(res => { this.setState({ task: res }); })
        
    }
    render() {
        return (
            <div>
                <h2>Lista de tareas</h2>
                <table>
                    <thead>
                        <tr>
                            <th>Id</th>
                            <th>Descripcion</th>
                            <th>Completada</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.task.map(ts => (
                            <tr key={ts.TaskListId}>
                                <td>{ts.TaskListId}</td>
                                <td>{ts.Description}</td>
                                <td>{ts.CompleteTask}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        );
    }
}

const element = <TaskComponent></TaskComponent>
ReactDOM.render(element, document.getElementById("root"));
